window.bookSummaryJSON = "<p>From <i>New York Times</i> best-selling authors Sarah Mlynowski, Lauren Myracle, and Emily Jenkins comes the second entry in this offbeat series about a group of magical misfits. </p> <p>In a world of elite magic academies, weird and wonderful things happen when you're sent off to public school...and put in the Upside-Down Magic class. </p> <p>Nory, Elliott, Andres, and Bax are back to prove that life on the other side of ordinary has its charms. </p>"; 
